import './App.css';
import Map from "mapmyindia-react";
import React from 'react';
import raw from './location.txt'; 
//var lat= 18.5314,long=73.845,i=0;
var lat,long,i=0;
/*fetch(raw)
.then(r => r.text())
.then(text => {
  lat = parseFloat(text.split(',')[0]);
  long = parseFloat(text.split(',')[1]);
  i+=1;
  console.log(i+'text decoded:', lat);
});*/



function App() {
  i+=1;
  fetch(raw)
      .then(r => r.text())
      .then(text => {
        lat = parseFloat(text.split(',')[0]);
        long = parseFloat(text.split(',')[1]);
        i+=1;
        console.log(i+'text decoded:', lat);
        return    (
          <Map
            markers={[
                { 
                    position: [ parseFloat(lat) , parseFloat(long)],
                    draggable: true, 
                    title:parseInt(i),
                    onClick: e => {
                        console.log("clicked ");
                    },
                    onDragend: e => {
                        console.log("dragged");
                    }
                }
            ]}
            />

       );
      });


  }

export default App;
